const sivisService = (() => {

  const quantidadeVisitantesIniciais = 120;


  Array.prototype.random = function () {
    return this[Math.floor((Math.random() * this.length))];
  }

  const portarias = ["Anexo I", "Anexo II", "Anexo II", "Anexo II", "Anexo III", "Anexo IV", "Anexo IV", "Anexo IV"];

  const tipos = ["Visitante", "Credenciado", "Servidor/Colaborador", "Convidado"];

  const destinos = ["Gab.100", "Plenario I", "Plenario I", "Plenario I", "Restaurante", "Restaurante", "Restaurante", "DEMED"];


  const minutosAdicionais = [0, 1, 1, 2, 2, 2, 5, 5, 10];

  let noVisitantes = 0;

  let visitantes = new Array();

  let dataCorrente = new Date(2019, 10, 3, 8, 0, 0);

  //Inicializa a colecao de visitantes  
  for (var i = 1; i <= quantidadeVisitantesIniciais; i++) {
    adicionaNovoVisitanteFunction();
  }

  function adicionaNovoVisitanteFunction() {
    visitantes.push(getNovoVisitante());
  }

  function getDataCorrentRandom() {

    dataCorrente = new Date(dataCorrente.getTime() + minutosAdicionais.random() * 60000);

    return dataCorrente;
  }

  function getNovoVisitante() {
    let visitante = new EntradaTO(++noVisitantes, getDataCorrentRandom(), 'Visitante ' + noVisitantes, portarias.random(), destinos.random(), tipos.random());

    return visitante;

  }

  function entradasRecentesFunction(dataInicial, dataFinal, qtdVisitantes) {

    return visitantes;


  }

  function getEntradasPorPortaria() {

    const totalPorPortaria = visitantes.reduce((mapa, visitante) => {
      if (mapa.has(visitante.portaria)) {
        let qtdPortariasAtualizado = mapa.get(visitante.portaria) + 1;
        mapa.set(visitante.portaria, qtdPortariasAtualizado);
        return mapa;
      }

      mapa.set(visitante.portaria, 1);
      return mapa;

    }, new Map());

    let entradasPorPortaria = [];

    for (const [key, value] of totalPorPortaria.entries()) {
      entradasPorPortaria.push(
        {
          "portaria": key,
          "entradas": value
        });
    }

    return entradasPorPortaria;

  }

  function getEntradasPorDestino() {

    const totalPorDestino = visitantes.reduce((mapa, visitante) => {
      if (mapa.has(visitante.destino)) {
        let qtdDestinosAtualizado = mapa.get(visitante.destino) + 1;
        mapa.set(visitante.destino, qtdDestinosAtualizado);
        return mapa;
      }

      mapa.set(visitante.destino, 1);
      return mapa;

    }, new Map());

    let entradasPorDestino = [];

    for (const [key, value] of totalPorDestino.entries()) {
      entradasPorDestino.push(
        {
          "destino": key,
          "entradas": value
        });
    }

    return entradasPorDestino;

  }


  function getEntradasPorHora() {

    let entradasPorHora = [];
    visitantes.forEach(visitante => {

      let d = visitante.dataHoraVisita
      let dataHoraVisita = new Date(d.getFullYear(), d.getMonth(), d.getDate(), d.getHours(), 0)

      var dataHoraEncontrada = false;
      entradasPorHora.forEach(entradaPorHora => {

        if (entradaPorHora.date.getTime() == dataHoraVisita.getTime()) {
          dataHoraEncontrada = true;
          entradaPorHora.value++;

        }
      });
      if (!dataHoraEncontrada) {
        entradasPorHora.push(
          {
            "date": dataHoraVisita,
            "value": 1
          });
      }


    });


    return entradasPorHora;

  }


  function getEntradasPorTipo() {

    const totalPorPortaria = visitantes.reduce((mapa, visitante) => {




      if (mapa.has(visitante.tipoVisita)) {
        let qtd = mapa.get(visitante.tipoVisita) + 1;
        mapa.set(visitante.tipoVisita, qtd);
        return mapa;
      }

      mapa.set(visitante.tipoVisita, 1);
      return mapa;

    }, new Map());

    let entradasPorTipo = [];

    for (const [key, value] of totalPorPortaria.entries()) {
      entradasPorTipo.push(
        {
          "tipo": key,
          "total": value
        });
    }

    return entradasPorTipo;

  }

  function getConvidadosPorRestricao(){


    const convidadosPorRestricao  = [{
      "tipo": "Demais",
      "total": 100
    }, {
      "tipo": "Alerta",
      "total": 20
    }, {
      "tipo": "Restrição",
      "total": 5
    }];
  
    return convidadosPorRestricao ;

  }

  function estatisticasEntradasFunction(dataInicial, dataFinal) {


    let estatisticas = {
      "totalEntradas": visitantes.length
      , "entradasPorHora": getEntradasPorHora()
      , "entradasPorPortaria": getEntradasPorPortaria()
      , "entradasPorTipo": getEntradasPorTipo()
      , "entradasPorDestino": getEntradasPorDestino()
      , "convidadosPorRestricao" : getConvidadosPorRestricao()
    };


    return estatisticas;

  }




  return {
    entradasRecentes: entradasRecentesFunction
    , estatisticasEntradas: estatisticasEntradasFunction
    , adicionaNovoVisitante: adicionaNovoVisitanteFunction
  }


})()

